import React from "react";
import "./Item.css";

const Item = ({ image, name, old_prices, new_price }) => {
  return (
    <div className="item">
      <img src={image} alt="" />
      <p>{name}</p>
      <div className="item-prices">
        <div className="old-price">{old_prices}</div>
        <div className="new-price">{new_price}</div>
      </div>
    </div>
  );
};

export default Item;
